import React, { Fragment } from 'react';
import { withRouter } from 'react-router-dom';

import BackButton from '../BackButton';



const layout = (props) => {
	const { location } = props;
	return 
	<Fragment>
		<BackButton />
		<main>
			{props.children}
		</main>
	</Fragment>
}

export default layout;
